import React, { useEffect, useState } from 'react';

import api from './services/api';

import './App.css';

var groups;
api.get('/').then(response => {
  groups = response.data;
  console.log(response.data[0])
});


function App() {
/*   const [groups, setGroups] = useState(); */
  var group1 = [];
  var group2 = [];
  var group3 = [];
  var group4 = [];

  api.get('/').then(response => {
    group1.push(response.data[0]);
    group2.push(response.data[1]);
    group3.push(response.data[2]);
    group4.push(response.data[3]);
  }) 

  return (
    <div>
      <ul>
        {group1.map(group => (
          <>
          <h2>Grupo 1</h2>
          <li key={group}>{group}</li>
          </>
        ))}
      </ul>
      <ul>
        {group2.map(group => (
          <>
          <h2>Grupo 2</h2>
          <li key={group.name}>{group.name}</li>
          </>
        ))}
      </ul>
      <ul>
        {group3.map(group => (
          <>
          <h2>Grupo 3</h2>
          <li key={group.name}>{group.name}</li>
          </>
        ))}
      </ul>
      <ul>
        {group4.map(group => (
          <>
          <h2>Grupo 4</h2>
          <li key={group.name}>{group.name}</li>
          </>
        ))}
      </ul>
    </div>
  );

}

export default App;
